// const svgFontDefinition = encodeURIComponent(`<defs><style>@import url('${FONT_FACE_CDN_URL}');</style></defs>`);

/* Auto Generated Start */
const font = `'data:font/woff2;charset=utf-8;base64,'`;
/* Auto Generated End */

const getSvg = (step: number, color: string, state: StepperState, theme: Theme): string => {
  const { baseColor, disabledColor } = getColor(state, theme);

  return `url("data:image/svg+xml,${encodeURIComponent(
    `<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 24 24' width='100%' height='100%'><defs><style>@font-face { font-family: Porsche Next; src: url(${font}) format('woff2'); }</style></defs><circle style='${
      state === 'current' ? `fill: ${baseColor};` : `fill: none; stroke: ${disabledColor};`
    }' cx='12' cy='12' r='9' /><text style='fill: ${color}; font-family:Porsche Next,sans-serif; line-height:1.125rem; font-size:0.75rem; font-weight:400' x='12' y='16.5' text-anchor='middle'>${step}</text></svg>`
  )}")`;
};

const getColor = (
  state: StepperState,
  theme: Theme
): { baseColor: string; hoverColor: string; iconColor: string; invertedBaseColor: string; disabledColor: string } => {
  const { baseColor, hoverColor, warningColor, successColor, disabledColor } = getThemedColors(theme);
  const { baseColor: invertedBaseColor } = getThemedColors(isThemeDark(theme) ? 'light' : 'dark');

  const colorMap: { [key in StepperState]: string } = {
    current: 'inherit',
    complete: successColor,
    warning: warningColor,
  };

  return { baseColor, hoverColor, iconColor: colorMap[state], invertedBaseColor, disabledColor };
};

export const getComponentCss = (state: StepperState, isDisabled: boolean, theme: Theme): string => {
  const { baseColor, hoverColor, iconColor, invertedBaseColor, disabledColor } = getColor(state, theme);
  const isCurrentOrUndefined = state === 'current' || !state;
  const hoverJssStyles = getHoverJssStyle();

  const svgColor = isDisabled ? disabledColor : invertedBaseColor;

  return getCss({
    '@global': {
      ':host': {
        display: 'flex',
        position: 'relative',
        ...(isCurrentOrUndefined && {
          ...Array.from(Array(9)).reduce(
            (result, _, i) => ({
              ...result,
              [`&(:nth-of-type(${i + 1}))`]: {
                '& $button': {
                  backgroundImage: getSvg(i + 1, svgColor, state, theme),
                  backgroundRepeat: 'no-repeat',
                  paddingLeft: pxToRemWithUnit(28),
                },
              },
            }),
            {}
          ),
        }),
      },
      button: {
        display: 'flex',
        alignItems: 'center',
        height: pxToRemWithUnit(24),
        color: isDisabled ? disabledColor : baseColor,
        transition: getTransition('color'),
        padding: 0,
        background: 0,
        border: 0,
        ...textSmall,
        whiteSpace: 'nowrap',
        cursor: isDisabled ? 'not-allowed' : 'auto',
        ...getFocusJssStyle(),
        ...(!isCurrentOrUndefined && {
          cursor: isDisabled ? 'not-allowed' : 'pointer',
          textDecoration: isDisabled ? 'none' : 'underline',
          ...(!isDisabled && {
            ...hoverJssStyles,
            '&:hover .icon': {
              color: hoverColor,
            },
          }),
        }),
      },
    },
    ...(!isCurrentOrUndefined && {
      icon: {
        color: isDisabled ? disabledColor : iconColor,
        marginRight: pxToRemWithUnit(4),
        transition: getTransition('color'),
      },
    }),

    'sr-only': {
      ...getScreenReaderOnlyJssStyle(),
    },
  });
};
